import React from 'react';
import Layout from '@components/ui/Layout';
import { useRouter } from 'next/router';

import Heart from '@assets/svg/ci_heart-fill.svg';
import Share from '@assets/svg/ci_share.svg';
import Gallery from '@assets/svg/gallery.svg';
import Key from '@assets/svg/key.svg';

export default function index() {
    const router = useRouter();
    return (
        <Layout>
            <div className="bg-white w-full  mt-32 flex justify-center">
                <div className="w-5/6 h-16 shadow-2xl rounded-lg"></div>
            </div>
            <div className="mt-16 w-full flex justify-center px-5">
                <div className="grid gap-6 2xl:grid-cols-3  xl:grid-cols-2 lg:grid-cols-2 md:grid-cols-1 grid-cols-1 lg:px-5">
                    <div className="w-97 h-48 bg-blue-300"></div>
                    <div className="w-97 h-48 bg-blue-300"></div>
                    <div className="w-97 h-48 bg-blue-300"></div>
                </div>
            </div>
        </Layout>
    );
}
